import React from "react";
import "../styles/app.css";
import PersonQuestionnaire from "./PersonQuestions";
import DogQuestionnaire from "./DogQuestions";

const App = () => {
  return (
    <div className="App">
      <h1>Pawfect Match</h1>
      <DogQuestionnaire />
      <PersonQuestionnaire />
    </div>
  );
};

export default App;
